import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    Botao: {
      marginTop: 20,
      alignItems: 'center',
      justifyContent: 'center',
      backgroundColor: '#17A558',
      width: 250,
      height: 50,
      left: 60,
      borderRadius: 50
    },
    Segundobotao:{
      marginTop: 10,
      alignItems: 'center',
      justifyContent: 'center',
      backgroundColor: '#B1D3C1',
      width: 250,
      height: 50,
      left: 60,
      borderRadius: 50
    },
    botaopular:{
      marginTop: 10,
      alignItems: 'center',
      justifyContent: 'center',
      width: 250,
      height: 50,
      left: 60,
      borderRadius: 50,
    },
    image: {
      right: 110,
      marginTop: -40
    },
    image2: {
      left: 97,
      marginTop: -60
    }
  })

  
  export default styles;
